package br.poli.ecomp.geav.nhe.model.db.ptc;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.pfl.IProfile;import br.poli.ecomp.geav.nhe.model.db.pro.IProject;import br.poli.ecomp.geav.nhe.model.db.usr.IUser;public class Participation extends Table implements IParticipation{	private int ptc_identificador;	private IProject pro_identificador;	private IUser usu_identificador;	private IProfile per_identificador;		public Participation(){}		@Override	public IProfile get_per_identificador() {		return this.per_identificador;	}	@Override	public IProject get_pro_identificador() {		return this.pro_identificador;	}	@Override	public int get_ptc_identificador() {		return this.ptc_identificador;	}	@Override	public IUser get_usu_identificador() {		return this.usu_identificador;	}	@Override	public void set_per_identificador(IProfile value) {		this.per_identificador = value;			}	@Override	public void set_pro_identificador(IProject value) {		this.pro_identificador = value;			}	@Override	public void set_ptc_identificador(int value) {		this.ptc_identificador = value;			}	@Override	public void set_usu_identificador(IUser value) {		this.usu_identificador = value;			}}